Explicación: Este poema es de José Rizal, el reconocido escritor, poeta y héroe nacional de Filipinas, quien vivió en el siglo XIX (1861-1896). El poema hace referencia a lugares y nombres significativos en la historia filipina, y el estilo y contenido son característicos de Rizal, quien fue un importante poeta y activista en la lucha por la independencia de Filipinas.
